import React from 'react';
import "../index.css";

function Resources() {
    return (
        <div class="content">
            <section class="rimg">
                <h1>Resources</h1>
            </section>
            <section class="rintro">
                <h1>Newsletters</h1>
                <img src="placeholder.jpg"></img>
                <h1>Blogs</h1>
                <img src="placeholder.jpg"></img>
                <h1>Chapters</h1>
                <img src="placeholder.jpg"></img>
                <h1>Podcasts</h1>
                <img src="placeholder.jpg"></img>
            </section>
        </div>
    );
}

export default Resources;
